@adoroszlai - I think anything going into `trunk` has to be assumed to be for Ambari 3.0. The feature branch for mpack v2 work (`branch-feature-AMBARI-14714`) has been around for a very, very long time. I can't imagine that we won't merge this into trunk within the next month or 2. 

This means that, yes, `trunk` should be 3.0. If we do any Ambari 2.7.x releases, it would be off of `branch-2.7`. If we have to do Ambari 2.8 for some horrible reason, then I would expect `branch-2.8` to be based off of `branch-2.7`.

The 8 failures are because those tests were using stacks from `src` instead of `test`. In most cases, they are defunct tests (checking Kerberos from HDP 2.2 does something, checking Ganglia, etc). I am working on a 2nd commit to remove the obsolete tests or change them to use the stacks from `test`.
